import React, { useState } from 'react';
import './index.css';

var a = new Date();
var [hour,run]=useState(a.getHours);
var [minute,run1]=useState(a.getHours);
var [second,run2]=useState(a.getHours);

function Time (){
   
    return (
        <>
        <h1 className="number"><span>{hour}</span>:<span>{minute}</span>:<span>{second}</span>  <span>{"PM"}</span></h1>
            <button onClick="Click" className="button">
                Click Me
            </button>
        </>
    );
}
function Click(){
    var a = new Date();
     [hour,run]=useState(a.getHours);
     [minute,run1]=useState(a.getHours);
     [second,run2]=useState(a.getHours);
}
function Nav(){
    return (
     <div className="nav">
         <h2>List of my favourate webseries</h2>
     </div>
 );
 }


function App(){
    return(
        <>
        <Nav/>
        <Time/>
        </>
    );
}
export default App;
